import React from 'react';
import PostDirectory from './PostDirectory.js';

const LogId = ({ logId }) => {

    const postDirectory = new PostDirectory();
    const logID = (logId === null || logId === undefined) ? postDirectory.getLastId() : logId;
    const log = (JSON.parse(localStorage.getItem(logID)) === null) ? getLogTemplate : JSON.parse(localStorage.getItem(logID));

    getDate = () => log.Day.Date;
    generateNewLogId = () => {
        const date = new Date()
        const st = date.toDateString().replace(/ /g,"");
        const nd = date.toLocaleTimeString().replace(/ /g,"");
        localStorage.setItem("lastPostId", `${st}${nd}`);
        const newId = `${st}${nd}`;
        console.log(`LogId: generateNewLogId => logID: ${newId}`);
        return newId;
    }
    getLogId = () => logID;

    templateData = {
        Day: {
            Date: "2020-01-17T08:00:00.000Z",
            Day: 17,
            Month: 1,
            Year: 2020
        },
        Location: {
            Break: "Notch"
        },
        Surf: {
            Height: "head high",
            Report: "4ft",
            Shape: "close-outs"
        },
        Swell1: {
            Height: "4ft",
            Direction: "NW",
            Angle: 280,
            Interval: 18,
        },
        Swell2: {
            Height: "2ft",
            Direction: "NW",
            Angle: 270,
            Interval: 8,
        },
        Swell3: {
            Height: "1ft",
            Direction: "NW",
            Angle: 180,
            Interval: 6,
        },
        Tide: {
            Phase: "High => Low",
            Height: "2ft"
        },
        Wind: {
            Direction: "NW",
            Orientation: "Offshore",
            MPH: "5mph",
            Surface: "Glassy"
        },
        Conditions: {
            Conditions: "Firing"
        },
        Comments: {
            "notes": "Biggest crowd but plenty of sick ones..."
        }
    };

    console.log(`LastLogId => render: this.state.logID: ${logID} - this.state.log: ${log}`);
    return <p>Count: {postDirectory.length}</p> 

}
export default LogId;
